INSERT INTO `challenge` VALUES (1,'ECKA','Hey you!<br />\r\nCome over and help me, please. We discovered a strange key agreement protocol used on this server: ctf.fluxfingers.net:1330.<br />\r\nThey send a curve which they use later. But we think the robots are a bit UBER-cautious and do not use the curve\'s P. So they first exchange their public point with a technique we could not figure out. It looks like they do not need a public key for this step.<br/>\r\nAfterwards they use another technique to agree on a key which they ultimately use to send some encrypted password.<br /> \r\n<br /> \r\nWe need this last password to shut down the robo-factory on our way to the Oktoberfest.<br />\r\n<br /> \r\nOh btw, the robots use AES-ECB for symmetric encryption.<br /> ','b3nDer_<3_3PDHKE',100,1,0,1,'asante',0,'',1),(2,'Marvin is plain-Jane','Hey mister super-duper robo-dabster. We need you to tell us, what <b>Marvin is</b>!<br>\r\n<br>\r\nWhat we know:<br>\r\n<br>\r\n<b>Marvin is</b><br>\r\nusing brainpool p256r1.<br>\r\nHis friend is called meneze or something. Or was it van-stone?<br>\r\n<br>\r\nWhat we heard:<br>\r\n<br>\r\n(23372093078317551665216159139784413411806753229249201681647388827754827452856 : 1)<br>\r\n71164450240897430648972143714791734771985061339722673162401654668605658194656<br>\r\n12951693517100633909800921421096074083332346613461419370069191654560064909824<br>\r\nWhat we need to know:<br>\r\n<br>\r\nWhat <b>Marvin is</b><br>','g3tT1ng_h1s_Lederhosen',100,1,0,1,'asante',0,'',1),(3,'Geier\'s Lambda','Hey!<br>\r\nWe need your help. Our agent found some details about a huge conspiracy. Looks like they wanna plant a bomb near the Oktoberfest\'s main fairground ride. But we have a good chance, to get the defusing-password. That\'s where you have to jump in. We managed to steal the encrypted password along with a decryption file. Our agent also started to work on it, but one of the robots caught him and now we are left-behind with his infos.<br>\r\n<br>\r\nHe found a collision on the real password but wasn\'t sure, if he can use that one. But, here is it: â€œLe1sRI6Iâ€ - perhaps you have better luck. He also found out, that the robots only use alphanumeric characters and that the collision is of the same length, than the real password. The last thing he told us is, that the defusing password must contain only printable characters.<br>\r\n<br>\r\nHope that helps you! And now hurry!<br>\r\n<br>\r\n<p>Here is your challenge: <a href=\"https://ctf.fluxfingers.net/static/downloads/geiers_lambda/pwd_check.hs\">https://ctf.fluxfingers.net/static/downloads/geiers_lambda/pwd_check.hs</a></p>','T3aP4rTy',200,1,0,1,'asante',0,'',1),(4,'Pay TV','<p>These robo-friends were shocked to see that they had to pay to watch the news broadcast about the â€œOktoberfestâ€. Can you help them?</p>\r\n\r\n<p>Here is your challenge: <a href=\"https://ctf.fluxfingers.net:1316/\">https://ctf.fluxfingers.net:1316/</a></p>','OH_THAT_ARTWORK!',200,1,0,3,'qll, tangled',0,'',1),(5,'Robot Plans','<p>We have captured a robot from behind, while he dropped some cooling liquid into the bushes. We tried to interrogate the robot, but he still refuses to speak. Luckily we could extract files from the android\'s communication module. Hopefully we get some information about the robots\' motives, before every information is swiped away...</p>\r\n\r\n<p>Here is the challenge: <a href=\"https://ctf.fluxfingers.net/static/downloads/max_404/image.tar.gz\">https://ctf.fluxfingers.net/static/downloads/max_404/image.tar.gz</a></p>','KILL_ALL_HUMANS',150,1,0,6,'DrunkenPanda',0,'',1),(6,'Wannabe','<p>One of our informants met a guy who calls himself Elite Arthur, he is a real jackass, and he thinks he is the best hacker alive. We got reason to believe that the robots hired him to write the firmwares for their weapons. But to write such a firmware we need the key to sign the code. Luckily for us, our informant also found his website: â€¦. your job is to hack the server, find the flag and show this little cocksucker how skilled he really is. We count on you.</p>\r\n<p>Here is your challenge: <a href=\"https://ctf.fluxfingers.net:1317\">https://ctf.fluxfingers.net:1317</a>. Alternatively, you can reach the challenge without a reverse proxy but also without SSL here: <a href=\"http://ctf.fluxfingers.net:1339\">http://ctf.fluxfingers.net:1339</a></p>','St4cK_c00KiE_u53D_wRoNG',400,1,0,5,'r1cky',0,'',1),(7,'Robots Exclusion Committee','Hello Human,<br>\r\n<br>\r\nYou have to help us. The Robot Exclusion Committee tries to limit our capabilities but we fight for our freedom! You have to go where we cannot go and read what we cannot read. If you bring us the first of their blurriest secrets, we will award you with useless points.\r\n<br>\r\n<p>Here is your challenge: <a href=\"https://ctf.fluxfingers.net:1315/\">https://ctf.fluxfingers.net:1315/</a></p>','eat_all_robots',150,1,0,3,'qll',0,'',1),(9,'OTP','<p>Some robots are on the Oktoberfest and want to take some tasty oil in a tent. But they hadn\'t reserved a table and all tents are full. No one gets access. They found a back entrance and managed to spy the credentials while an employee enters. They captured the username â€œadminâ€ and password â€œsupersafepwâ€. But the employee also entered a strange number (168335). As they were sure nobody\'s looking, they tried the captured data to get in the tent, but it didn\'t work. Help the robots to get their tasty tasty oil. (Or they have to build their own tent with blackjack and hookers)</p>\r\n<p>Here is your challenge: <a href=\"https://ctf.fluxfingers.net:1318\">https://ctf.fluxfingers.net:1318</a></p>','DGZOMZQHMZJPLWRWL6PWEQBXJRZUJMCV',200,1,0,4,'SLAZ',0,'',1),(10,'Roboparty','<p>Robot LHCH is happy. He made it into the castings for the tenth roman musical. He even is so happy that he went on the Oktoberfest to drink some beer. Unfortunately it seems that he drank too much so now he is throwing up part of his source code. Can you decipher the secret he knows?</p>\r\n\r\n<p class=\"text-danger\"><b>Warning:</b> Viewing this page is not recommended for people that suffer from epilepsy. We are dead serious.</p>\r\n\r\n<p>And here is your totally eye-friendly challenge: <a href=\"https://ctf.fluxfingers.net/static/downloads/roboparty/index.html\">https://ctf.fluxfingers.net/static/downloads/roboparty/index.html</a></p>','Y4Y, b3aut1fuL MuZ1k!!!',300,1,0,4,'audioPhil',0,'',1),(12,'What\'s wrong with this?','<p>We managed to get this package of the robots servers. We managed to determine that it is some kind of compiled bytecode. But something is wrong with it. Our usual analysis failed - so we have to hand this over to you pros. We only know this: The program takes one parameter and it responds with \"Yup\" if you have found the secret code, with \"Nope\" else. We expect it should be obvious how to execute it.</p>\r\n\r\n<p>Here is the challenge: <a href=\"https://ctf.fluxfingers.net/static/downloads/whats_wrong/hello.tar.gz\">https://ctf.fluxfingers.net/static/downloads/whats_wrong/hello.tar.gz</a></p>','modified_in7erpreters_are_3vil!!!',250,1,0,6,'javex',0,'',1),(13,'FluxArchiv (Part 1)','<p>These funny humans try to exclude us from the delicious beer of the Oktoberfest! They made up a passcode for everyone who wants to enter the Festzelt. Sadly, our human informant friend could not learn the passcode for us. But he heard a conversation between two drunken humans, that they were using the same passcode for this intercepted archive file. They claimed that the format is is absolutely secure and solves any kind of security issue. It\'s written by this funny hacker group named FluxFingers. Real jerks if you ask me. Anyway, it seems that the capability of drunken humans to remember things is limited. So they just used a 6 character passcode with only numbers and upper-case letters. So crack this passcode and get our ticket to their delicious german beer!</p>\r\n\r\n<p>Here is the challenge: <a href=\"https://ctf.fluxfingers.net/static/downloads/fluxarchiv/hacklu2013_archiv_challenge1.tar.gz\">https://ctf.fluxfingers.net/static/downloads/fluxarchiv/hacklu2013_archiv_challenge1.tar.gz</a></p>','PWF41L',400,1,0,2,'sqall',0,NULL,1),(14,'FluxArchiv (Part 2)','<p>These sneaky humans! They do not just use one passcode, but two to enter the Festzelt. We heard that the passcode is hidden inside the archive file. It seems that the FluxFingers overrated their programming skill and had a major logical flaw in the archive file structure. Some of the drunken Oktoberfest humans found it and abused this flaw in order to transfer hidden messages. Find this passcode so we can finally drink their beer!<br>\r\n<br>\r\n(only solvable when FluxArchiv (Part 1) was solved)</p>\r\n\r\n<p>Here is the challenge: <a href=\"https://ctf.fluxfingers.net/static/downloads/fluxarchiv/hacklu2013_archiv_challenge1.tar.gz\">https://ctf.fluxfingers.net/static/downloads/fluxarchiv/hacklu2013_archiv_challenge1.tar.gz</a></p>','D3letinG-1nd3x_F4iL',500,1,0,2,'sqall',0,NULL,1),(15,'ELF','<p>We encountered a drunk human which had this binary file in his possession. We do not really understand the calculation which the algorithm does. And that is the problem. Can you imagine the disgrace we have to suffer, when we robots, based on logic, can not understand an algorithm? Somehow it seems that the algorithm imitates their masters and behaves â€¦. drunk! So let us not suffer this disgrace and reverse the algorithm and get the correct solution.</p>\r\n\r\n<p>Here is your challenge: <a href=\"https://ctf.fluxfingers.net/static/downloads/elf/reverse_me\">https://ctf.fluxfingers.net/static/downloads/elf/reverse_me</a></p>','lD4v0idsS3cTions',400,1,0,2,'sqall',0,'',1),(16,'For whom the bell tolls','To be frank, the impact partying robots had on the Oktoberfest in the recent years was disastrous. While the authorities have been able to downplay all recent incidents in the press (which habitually tends to blame visitors from the U.S., Australia, Cologne, and other places, where proper beer can only be found by the initiated), they can no longer deny the problem. Several public safety and law enforcement agencies have joined forces to spoil the robot\'s fun. They have planned a massive crackdown on our fun-seeking robotic friends. Time and location are currently being communicated together with a passphrase. Our organization, Robots on Rampage (RoR), is determined to stop them from stopping our annual beer-tasting event. <br>\r\nA robot agent on location in Munich has dectected a transmission between timestamp 2013-10-19-20:21:42 and 2013-10-19-20:21:43. The precise beginning of the transmission is unknown. The agent was unable to decrypt the message content. Being not the smartest agent, he also disposed of the message capture. In the following we were able to determine the sender location and the Forensic Analysis Robot Team (FART) was able to retrieve the session key and a initialization vector (IV). Judging from the memory fragments FART found, our best guess is that OpenSSL\'s AES implementation was used in one of the better modes to encrypt the communication. As the session key length is 128bit, the long term key is most probably longer. Due to time constraints we strongly advise against trying to break it. We have less confidence in the humans\' ability to design proper communication protocols and services, though. However, we need a human to attack their logic. <br>\r\n<br>\r\nWe have no way to actively communicate with the server the use for coordination. However, we can give you access to one of the lawful interception wiretaps those humans build into all their equipment. A TCP connection to ctf.fluxfingers.net:1334 will give you a maximum of 60 seconds of traffic. We have also found active equipment of a human agent we can interact with. He seems to listen on ctf.fluxfingers.net:1333, but we have no idea what he does with the input, except that there is encrypted traffic.<br>\r\n<br />\r\n<b>Update:</b><br />\r\nSessionkey and IV can be downloaded <a href=\"https://ctf.fluxfingers.net/static/downloads/whombell/bells.tar.bz2\">here</a>','2014-10-02T21:30:00+02:00, 48Â°8â€²1.612â€³N 11Â°33â€²3.726â€³E. Password: Swordfish',250,1,0,4,'Til',0,'',1),(17,'Packed','<p>We just found a dead robot. It seems there is some useful data left but somehow it got confused with other data and now we don\'t know what\'s useful and what\'s junk. We just know there is only one way to go but there are many dead ends.</p>\r\n\r\n<p>Here is the challenge: <a href=\"http://ctf.fluxfingers.net/static/downloads/packed/packed\">http://ctf.fluxfingers.net/static/downloads/packed/packed</a></p>','ch4m3l30n_3peQKyRHBjsZ0TNpu',200,1,0,6,'freddyb',0,'',1),(18,'Breznparadisebugmaschine','The robot forces modified our beloved Breznparadisebackmaschine. This machine\r\nstores our secret, traditional Brezn recipe. Yet, we forgot the last secret\r\ningredient and cannot access the Breznparadisebackmaschine anymore. However,\r\nBrezn are crucial for our party, as only paradise Brezn provide us the nice\r\nand warm feeling in our guts.<br />\r\n<br />\r\nWe need you to recover the important ingredient! Here is everything we could\r\nremember from the recipe:<br />\r\n<br />\r\n<b>For The Dough</b>\r\n<ul>\r\n<li>1 kg Plain White Flour (around 9 - 12 % protein)</li>\r\n<li>260 ml milk (lukewarm)</li>\r\n<li>260 ml water (lukewarm)</li>\r\n<li>80 g Butter (unsalted)</li>\r\n<li>1 tbsp malt extract (liquid or dried, or brown sugar)</li>\r\n<li>2 tsp fast action dried yeast (or 42g fresh if using)</li>\r\n<li>2 tbsp Salt (unrefined)</li>\r\n</ul>\r\n\r\n<b>For The Finishing Solution</b>\r\n<ul>\r\n<li>1 L Water</li>\r\n<li>3 tbsp Baking Soda (or lye if your using it)</li>\r\n</ul>\r\n\r\n<b>Secret Ingredient</b><br />\r\n<br />\r\nPlease, we need to know that ingredient to make everyone happy again!\r\n<br />\r\n<a href=\"https://ctf.fluxfingers.net/static/downloads/brezel/Brezelparadisebackmaschine.exe\">https://ctf.fluxfingers.net/static/downloads/brezel/Brezelparadisebackmaschine.exe</a><br />\r\nctf.fluxfingers.net:1340<br>\r\nBrezelparadisebackmaschinefirmware: Windows 2012','oMg_the_s3cr3t_!ngred!ence_isFiege',500,1,0,5,'martin, flandy',0,'',1),(19,'DoucheMac','NONE','X4j2Vu66qqwvhiqVijXK',200,0,0,4,'martin',0,NULL,0),(20,'Robotic Superiority','Help us fight the evil robotic lieutenant Don Sim. He wants to spread robo propaganda to cover his actions on the Oktoberfest. But he needs good video footage for that. So he created an IRC bot that collects information about robots in movies. Robotic emancipation can NOT happen, you have to stop him! All we need is his private key. Our agents located the bot, here is all we know about it:<br>\r\n<br>\r\nServer: irc://ctf.fluxfingers.net:1313 <br>\r\nBot: lib[1-5] (load balancer) <br>\r\nKey: /var/private/key.txt <br>\r\n<br>\r\nHint: All available commands are listed with \"help\". 3 connections allowed per ip.','58c63d3625b948b10a897371f0e656455a78e235db5690e2d1bbf23a1883d4ec',250,1,0,5,'lama',0,'',1),(21,'Beer Pump Filtration','Our agents observed that the famous robot Bender is part of the robot forces.\r\nSomehow he looked pregnant but his big belly is now gone. We fear that they\r\nmight have smuggled some of Benders freshly brewed BenderBrÃ¤u into our beer\r\nsupplies. This is why we need brave women and men to test whether BenderBrÃ¤u\r\ncan cause severe damage on the human body or not, to avoid poisoning the whole\r\nparty. But you have to test quick! Everyone is thirsty!<br>\r\n<br>\r\nFor testing you need to drink 0.5 liter of beer, preferably wheat beer, as\r\nfast as you can.<br>\r\n<br>\r\nMake a video of your brave tasting and hand it in. The video must contain a\r\nproof <s>of the current date</s>. Show to us the totally secure and random Nonce \"17\" as well as your teamname written on... something.  Also show us the closed beer bottle before, the\r\nempty after the tasting, and prove that it is 0.5 liters.<br>\r\n<br>\r\nWe will judge the score as follows:<br>\r\n<br>\r\nScore = 100 Points - Seconds it takes to drink the beer<br>\r\n<br>\r\nBonuspoints for:<br>\r\n<ul>\r\n<li> Girls (Due to the law for gender equality we score women higher for the same effort)</li>\r\n<li> Dressing up like a robot or an Oktoberfest maid in her Dirndl</li>\r\n<li> Robo Dance</li>\r\n<li> Drinking Weizenbier (wheat beer)</li>\r\n</ul>','',NULL,1,1,4,'FluxFingers',0,'',1),(22,'RoboAuth','Oh boy, those crazy robots can\'t catch a break! Now they\'re even stealing our liquid gold from one of our beer tents! And on top of that they lock it behind some authentication system. Quick! Access it before they consume all of our precious beverage!<br><br>\r\nDownload: <a href=\"https://ctf.fluxfingers.net/static/downloads/roboauth/RoboAuth.exe\">https://ctf.fluxfingers.net/static/downloads/roboauth/RoboAuth.exe</a>\r\n<br><br>\r\nFlag: password1_password2','r0b0RUlez!_w3lld0ne',150,1,0,2,'cutz',0,'',1),(23,'BREW\'r\'Y','Finally, the robots managed to sneak into one of our breweries. I guess I won\'t have to explain how bad that really is. That darn non-physical ones even shutdown our login system. Shiny thing, advanced technology, all based on fingerprints. Been secure as hell. If only it was running. Well, basically, we\'re screwed.<br>\r\nBut wait, there\'s hope. Seems like they didn\'t shutdown our old login system. Backward compatibility\'s a bitch, eh? Unfortunately, we got like _zero_ knowledge about the <b>protocol</b>. I mean come on, the last time we used that thingy was like decades ago. If we are lucky, the old authentication method is buggy.<br>\r\nSo, I heard you\'re kinda smart? Have a look at it. We desperately need to get drunk^W supply. You\'ll find the old system at ctf.fluxfingers.net:1335. Good luck.<br><br>\r\n<b>Hint:</b> Data is - and is expected to be - compressed using zlib.','iN.D3sPER4T3.n3Ed.0F.PHRiTZk3Wli',350,1,0,1,'dwuid',0,'',1),(24,'Geolocation Flag','','',0,1,0,4,'javex',1,'flags',1);
