INSERT INTO `news` VALUES (1,'2013-10-21 20:00:26','[Begin Mission Briefing]<br>\r\nHello everyone,<br />\r\n<br />\r\ngood to see that so many joined us in our fight for freedom. The robot forces are rising and threaten our Wiesn party. They already captured our main Wiesn party tent and they are about to overrun our breweries. To avoid more damage, we need you to protect the entrances to Oktoberfest, defend the breweries, and regain control of our main beer pump located in the main tent, so that we can continue to party and satisfy our thirst!<br>\r\n<br>\r\nWe gathered different challenges that you have to solve, to help us fight back the robot forces. Solving even a single one will help us on our way to take back the fairground from the robots. Feel free to find yourself a group of like-minded people and hack ALL the robots.<br />\r\n<br />\r\nNow, get ready, grab your keyboards, and rock!<br />\r\n[Mission Briefing Ended]<br /><br />\r\n\r\nWe will publish new annoucements and hints on this page. Meanwhile you can join our IRC channel <a href=\"irc://chat.freenode.net/fluxfingers\">#fluxfingers</a> or visit our Twitter account <a href =\"https://twitter.com/fluxfingers\">fluxfingers</a> for critical information, if something is down.\r\n\r\nAlmost all challenges are available at start, but few challenges are delayed.',1,NULL),(2,'2013-10-22 08:59:20','For Local Teams:\r\n\r\nPlease come to our desk to register as a local team. Local teams can win prices, but only after registration!',1,NULL),(3,'2013-10-22 09:05:00','New Challenge Published:<br />\r\n<b>#14 For whom the bell tolls (Misc)</b><br />\r\n<br />\r\nHave fun with it!',1,16),(4,'2013-10-22 12:30:17','New Challenge partially online! Server is not set up yet.',1,18),(5,'2013-10-22 13:41:52','As Lieutenant Don Sim realized, his bots are under heavy load. So he just started lib6, ..., lib9 as additional load balancers.',1,20),(6,'2013-10-22 13:48:09','Version Controll has tricked us. Here is the latest version of pwd_check',1,3),(7,'2013-10-22 14:28:25','We experienced high load on our servers due to the use of scanners. Please DO NOT use them. If we catch you, we have to ban you!<br />',1,NULL),(8,'2013-10-22 14:31:27','We managed to reestablish the connection to the Breznparadisebugmaschine! The service is now up.',1,18),(9,'2013-10-22 14:53:57','Ah, perhaps it helps you to know, that our Breznparadisebugmaschinefirmware is up to date with Windows 2012.',1,18),(10,'2013-10-22 15:45:54','New Challenge Published: The robots took our brewery! Will you help us to get it back?',1,23),(11,'2013-10-22 19:50:56','We fixed a tiny bug in BREW\'r\'Y, it\'s back now. No game changer, if you\'re on track you\'ll notice.',1,23),(12,'2013-10-22 21:05:19','OK everybody. You did a great job till now. Night is coming, stay awake and watch out for random robots appearing near you.',1,NULL),(13,'2013-10-23 08:33:42','Guuuuuud morning everyone! Hope you had a save night and enjoyed some Weizenbier! Back to work now..',1,NULL),(14,'2013-10-23 08:43:03','It seems that there are some problems with some Linux Distributions that lead to a wrong flag. The flag is printable and is written in leet-speak. We are working on a VM that works correctly with this challenge. When the VM is ready, you can download it and try again. Sorry for the inconvenience. ',1,15),(15,'2013-10-23 08:59:37','For all robo hunters out there: Your quest-description was updated - check it!',1,1),(16,'2013-10-23 09:18:41','New Hints appeard! <br />\r\nRoR has determined that the human agents acts as a proxy and requests meeting place, time and password for others. We think the first message he sends serves to agree on a session key for the answer.\r\nRoR analysts have also been staring at pcaps a lot lately. We think that on port 1832 (which we can only monitor passively) we are observing a key establishment that follows the simple ISO/IEC 11770-2 Mechanism 1. However, on tcp/1333 our analysts say that marshalled Ruby DateTime objects are flying by. Not sure, why anyone would do this, but given what we see on the other port, it makes sense (in a \r\ntwisted way).<br />\r\n<br />\r\nAdditionally we uploaded a .tar.bz file containing the session key and the IV. ',1,16),(17,'2013-10-23 09:38:10','Hint: He, we have the latest news for you. The first part of their strange key agreement was designed by the famous SHA-Robot ÐœÐ¸Ñ€!',1,1),(18,'2013-10-23 09:56:22','Ok I think we got it (thanks to Happy-H from Team ClevCode). Ubuntu introduced a patch to disallow ptracing of non-child processes by non-root users. This changes the calculated value. So when you use Ubuntu you should work as root. The other distributions should not be affected. \r\n\r\nAnyway, I created a VM where the executable works just fine: http://h4des.org/ELF.ova (User: elf:elf and root:root)',1,15),(19,'2013-10-23 11:29:37','Hint: It\'s neither Velato nor Fugue.',1,10),(20,'2013-10-23 12:36:55','New Challenge Published: We found a dead robot! Want to take a look at its internals?',1,17),(21,'2013-10-23 13:15:17','Added an additional URL for the channel without the reverse proxy, but also without ssl',1,6),(22,'2013-10-23 14:34:17','Think outside the box - being several types at once like an animal that can change its color. Excuse the inaccuracy, but that\'s what you\'re searching for.',1,17),(23,'2013-10-23 14:58:07','We just extended the CTF by a half hour because it started about half an hour later as well. So the CTF will end on 2013-10-24 08:30:00 UTC now.',1,NULL),(24,'2013-10-23 16:42:01','Local staff is helplessly wandering around in Luxembourg in order to get food and beverages. See you later!',1,NULL),(25,'2013-10-23 20:03:35','Okay you can stop struggling now: XSS is not the way; leave the http cookie alone; get RIP to do the final trick!',1,6),(26,'2013-10-23 20:07:01','The flag starts with \'Y4Y,\'',1,10),(27,'2013-10-23 22:13:40','<b>Hint:</b> The challenge text gives hints about the protocol involved. We updated it in order to reflect that fact.',1,23),(28,'2013-10-24 08:13:09','Ruby Version 1.8.7',1,16),(29,'2013-10-24 08:30:26','Hey all, we hope you enjoyed the ctf!<br>\r\nThe ctf is over - please give us some feedback, so we can improve our next ctf. We would appreciate it, if you can send us a mail (fluxfingers (at) rub.de), answering the following (or a subset of) questions:<br>\r\n<br>\r\nWhich challenge(s) did you like most? Why?<br>\r\nWhich challenge(s) did you dislike? Why?<br>\r\nDo you think there were too many/few challenges?<br>\r\nDid you miss a certain challenge category (reversing/web/<s>stegano</s>/crypto/you-name-it)?<br>\r\nWere there enough challenges in each category or was a category imbalanced?<br>\r\nDid you like the scoreboard/theme?<br>\r\nAre you satisfied with the support?<br>\r\nWhat should we do better next time?<br>\r\n<br>',1,NULL);
